import React from "react";
import "./GoodsCard.css"

const GoodsCard = (props) =>{
    return (
        <div className="GoodsCard">
         <div className="goodscard-wrapper">
                <div className="goods-name">{props.goodsname}</div>
                <div className="goods-name">{props.goodsdiscripion}</div>
         </div>
         <div className="goodscard-wrapper">
                <div className="goods-name">{props.goodsname}</div>
                <div className="goods-name">{props.goodsdiscripion}</div>
         </div>
        </div>
        
    );
}

export default GoodsCard;
